	(8480000876775, 'Tarta carrot cake Hacendado congelada', 'https://prod-mercadona.imgix.net/images/2954d29d405e5927d6b899c1109ee7f7.jpg?fit=crop&h=600&w=600', 'Bizcocho calado (57%) (azúcar moreno, huevo  líquido pasteurizado, harina de trigo (gluten), agua, zanahoria  confitada (zanahoria rallada (2%), jarabe de glucosa y fructosa, azúcar, corrector  de acidez (ácido cítrico), conservadores (sorbato potásico, metabisulfito sódico  (sulfitos)), colorantes (E-101, E-120), aroma), aceite refinado de  girasol, azúcar, nueces, gasificantes (E-450i, E-500ii), sal, emulgentes  (E-471, E-1520, E-477, E-470a), estabilizante (goma xantana), especias (canela,  jengibre, nuez moscada), colorante (E-150c), conservadores (ácido sórbico,  sorbato potásico)), crema de queso (35%) ((queso batido (17%) (mazada (leche),  leche, nata (leche), sólidos lácteos (leche),  sal, aroma, estabilizante (carragenato), fermentos lácticos (leche)), azúcar, leche desnatada en polvo, grasas de palma y palmiste, aceite refinado de girasol, jarabe de glucosa y fructosa,  maltodextrina, zumo de limón, emulgentes (E-492, lecitina de soja),  aroma, sal, antiaglomerante (E-536)), relleno salsa caramelo (1,5%) (jarabe de  glucosa, leche condensada, agua, grasa vegetal de coco, azúcar, glucosa,  espesante (almidón modificado), gelificante (pectina), sal, emulgente (E-471),  aroma natural), galleta (0,57%) (almidón de maíz, harina de maíz, aceite refinado  de girasol alto oleico, azúcar, jarabe de glucosa y fructosa, harina de arroz,  sal, gasificantes (E-500ii, E-503ii), emulgente (lecitina de soja),  aroma), avellana (0,4%), jarabe de glucosa y fructosa, aceite refinado  de girasol. Puede contener trazas de otros frutos de cáscara y mostaza.', 'Hacendado', 0, 0),
	(8712000011079, 'Cerveza Heineken', 'https://prod-mercadona.imgix.net/images/5a90d9228eee2559bccb8fb03e710d11.jpg?fit=crop&h=600&w=600', 'Agua, malta de cebada y extracto de lúpulo. Este producto se elabora con malta de cebada. Contiene gluten', 'Heineken', 0, 0),
	(8712100739231, 'Té negro PG tips', 'https://prod-mercadona.imgix.net/images/f57b0efdc91994ad86aa6e8843a88876.jpg?fit=crop&h=600&w=600', 'Té negro.', 'PG tips', 0, 0),
