	(9902000333359, 'Patatas fritas onduladas Hacendado sabor jamón serrano', 'https://prod-mercadona.imgix.net/images/41b35be6c5ee188dfe096fe4de8e0ded.jpg?fit=crop&h=600&w=600', 'Patata, aceite de girasol (33%) y aroma sabor jamón [maltodextrina,sal,aroma,potenciadores del sabor(glutamato monosódico, inosinato disódico y ganilato disódico) y aroma de humo]. Contiene trazas de leche.', 'Hacendado', 0, 0),
